import React from 'react';
import Lists from './Lists';
const AllLists = () => {
  return (
    <div>
     {lists &&
        lists.map((list) => {
          return (
            <Link to={`list/${list.id}`} key={list.id}>
              <Lists list={list} />
            </Link>
          );
        })}
    </div>
  );
};

export default AllLists;
